import React from "react";
import "./styles/Navigationbar.css";

const searchbar = props => (
  <form className="searchbar">
    <input
      className="input"
      id="search"
      label="Suche"
      type="text"
      placeholder="Was suchen Sie?"
    ></input>
  </form>
);

export default searchbar;
